  02> KIRKPATRICK, Sarah Kate
  b 13.02.1978
  Sarah b. at Gisborne. She was educated at Woodford House and has studied photography in
  Wellington. She is now studying fashion and design at the Christchurch Polytechnic.
  03> KIRKPATRICK, Victoria Jane
  b 11.05.1979
  Victoria b. at Gisborne. She was educated at Woodford House and is now studying at Lincoln
  University.
  04> WILLIAMS, Arnold m on 23.01.1981 to ROBINSON, Kaye Patricia
  Christopher
  b 14.09.1957
  b 22.06.1960
  Christopher b, at Gisborne and m. at Dunedin. Kaye, d/o Jack and May Robinson, b, at Palmerston,
  Otago. Address: "Mutuera" Station, Private Bag 7614, Gisborne.
  Christopher was educated at Wainui Beach School, Hereworth School and Wanganui Collegiate School.
  He was a prefect at Hereworth and Wanganui and played for the 1st rugby XV and 1st cricket XI at
  both schools.
  Kaye was educated at Palmerston and at St Hilda's in Dunedin. She won the New Zealand Lady
  Showjumping Rider of the Year in 1983, and the C-grade Horse of the Year with Main Stream. She is
  still competing locally where she is Chairman for the Gisborne Area of the New Zealand Equestrian
  Federation and a member of the New Zealand Showjumping Committee.
  Chris and Kaye farm "Mutuera" station, 64kms west of Gisborne, where they run sheep, cattle and
  deer.
