  02>' WILLIAMS, Margot Temple m on 25.06.1948 to FRASER, Alec Mac
  b 09.04.1921
  b 19.11.1917
  Margot b. at Gisborne and m. at Ruatoria. Mac, s/o Tom Fraser and Helena
  Hansen, b. at Gisborne. Address: "Waitaheke", RD 4, Te Karaka, Gisborne.
  Margot was educated at Woodford House (prefect) and was a land girl during the
  war. Mac farmed at "Waitaheke", Whatatutu and is now retired, He served in the
  5th Field Regiment during WW2.
